            result.json().then(res => {
                console.log("ðŸš€ ~ file: index.js:11 ~ result.json ~ res:", res.users)
                setData(res.users)
            })
        })
    }, [])

  return (
    <div>
      <h1>User Listing</h1>
      {data?.map((val, index) => (
        <ProfileCrd data={val} />
